import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { NavLink } from 'react-router-dom';
import classes from './login.module.css';
import passwordIcon from '../assets/passwordIcon.png';
import usernameIcon from '../assets/usernameIcon.png';
// import Login from './components/login';
// import SignUp from './components/signup';





function Login() {
    return (
        <div className={classes.login}>
         <div className={classes.buttons}>
             <p>Welcome Back</p>
             <p>Login to your account</p>
             <div className={classes.button}>
                <div className={classes.inputContainer}>
                    <img src={usernameIcon} className={classes.icon} />
                    <i class="fa fa-user icon"></i>
                    <input type="email" placeholder="Email" className={classes.input} />

                </div>
                <input type="password" placeholder="Password" className={classes.input} />
                <div className={classes.loginOptions}>
                    <div className={classes.rememberMe}>
                        <input type="checkbox" className={classes.checkbox} />
                        <label className={classes.label}>Remember Me</label>
                    </div>
                    <label className={classes.label}>Forget Password?</label>
                </div>
                <NavLink to="/login" className={classes.loginNav}>Login</NavLink>
                <div className={classes.organizer}>
                    <p>An Organizer?</p>
                    <NavLink to="#" className={classes.organizerAccount}>Login or Sign Up</NavLink>
                </div>
             </div>

         </div>

        </div>

       );
}

export default Login;
